import React from 'react';
import './App.css';
import ListOfGifs from './components/ListOfGifs'


import { Link ,Route } from 'wouter'

function App() {
  return (
    <div className="App">
      <section className="App-content">
       <Link to='/'>
        <img src='/logo.png' alt="Giffy Logo" className="App-logo"/>
       </Link>
       <Route 
        component={Home}
        path='/'
        />
        <Route 
          component={SearchResults}
          path='/search/:keyword' 
        />
        <Route 
          component={Detail}
          path='/gif/:id'
        />   
      </section>
    </div>
  );
}

export default App;
